const Banner = () => {

  return (


  <BannerContainer>
    <AudioMeter />
    <BannerText>
              Subscribe for 1 free digital master <HeaderLineBreak />& booking rates
              <div id="mc_embed_signup">
                <MailchimpSubscribeForm />
              </div>
    </BannerText>
  </BannerContainer>
  )
};

export default React.memo(Banner);
